svg.script:
var svg = document.getElementById("lmpMap");
svg.onclick=function(event){
    if( svg.getAttribute("class") == "is-full" ) {
        svg.setAttribute("class", "is-zoomed");
    } else {
        svg.setAttribute("class", "is-full");
    }
}
function showImg(id) {
    document.getElementById(id).setAttribute("class", "is-visible");
}
function hideImg(id) {
    document.getElementById(id).setAttribute("class", "is-hidden");
}
